import React from 'react'
import { Form, Container, Grid } from 'semantic-ui-react'

const Goal = ({match, props}) => {
  return (
    <div className='grid-container'>
      <div className='grid-item'>
        <h4>Goal Date:</h4> {props.goal.goalDate}
        <h4>Bedtime Target:</h4> {props.goal.bedtimeTarget}
        <h4>Wakeup Time Target:</h4> {props.goal.wakeupTarget}
      </div>
    </div>
  )
}

export default Goal
